SELECT ((筹资活动现金流入小计 - (SELECT 筹资活动现金流入小计 FROM Cash_Flow_Statement WHERE 年度=2021 AND 股票简称='深深房A')) / (SELECT 筹资活动现金流入小计 FROM Cash_Flow_Statement WHERE 年度=2021 AND 股票简称='深深房A')) * 100 
 FROM Cash_Flow_Statement 
 WHERE 年度=2022 AND 股票简称='深深房A';

