FROM Balance_Sheet
WHERE 股票简称 = '北方国际' AND 截止日期 = '2022-12-31';

SELECT ((应收票据净额 - LAG(应收票据净额, 1) OVER (ORDER BY 截止日期)) / LAG(应收票据净额, 1) OVER (ORDER BY 截止日期)) * 100 as 应收票据净额同比增长率
 FROM Balance_Sheet
 WHERE 股票简称 = '中集集团' AND 截止日期 = '2022-12-31';

